import NavBar from "./NavBar";

class App extends Component{
    // React code goes here

    constructor(props){
        super(props)
        this.state = {
            account:'0x011111'
        }
    }

    render(){

        return(
            <div className="text-center" style={{color:'green'}}>
                <NavBar account={this.state.account}/>
            </div>

        )
    }

}

export default App;
